import React, { useState,useEffect } from 'react'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';

import { Formik, Form ,Field} from 'formik'
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import IconButton from '@mui/material/IconButton';
import CloseIcon from '@mui/icons-material/Close';
import Typography from '@mui/material/Typography';
import InteviewPortal from './InteviewPortal';
import axios from 'axios';
//button/-----
const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  '& .MuiDialogContent-root': {
    padding: theme.spacing(2),
  },
  '& .MuiDialogActions-root': {
    padding: theme.spacing(1),
  },
}));


const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: '#1976d2',
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  // hide last border
  '&:last-child td, &:last-child th': {
    border: 0,
  },
}));

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];

const currencies = [
  {
    value: 'USD',
    label: '$',
  },
  {
    value: 'EUR',
    label: '€',
  },
  {
    value: 'BTC',
    label: '฿',
  },
  {
    value: 'JPY',
    label: '¥',
  },
];

const Tokan="eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY3ODA4YTE3MzRkZGY2ZjZlZGUyNTRmMSIsImlhdCI6MTc0MzA1NTQyMn0.aZYxyCRQ1STR-TFhknYeX8hpE5jBi2jFSqTnt5RLXHU"

const QandA = () => {
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };

  const [ini,setIni]=useState({
    questions:'',
    answer:''
  })
  const [list,setList]=useState([])
 const [list1,setList1]=useState([])
  const [list2,setList2]=useState([])

  const handleSubmit=(values,{resetForm})=>{
    axios.post('https://interviewback-ucb4.onrender.com',values,{
      headers:{
        Authorization:'Tokan'
      }
    })
    .than(()=>{
      console.log('data enter succes');
      dataView()
    })
    .catch((error)=>{
      console.log(error);
    })
  }
  function dataView(){
    axios.get('https://interviewback-ucb4.onrender.com',{
      headers:{
        Authorization:'tokan'
      }
    })
    .then((res)=>{
      console.log(res.data.data)
      setList2(res.data.data)
    })
    .catch((error)=>{
      console.log(error)
    })
  }
  useEffect(()=>{
    dataView()
  },[])
  return (
    <>
      <InteviewPortal>
        <Box sx={{ width: '100%', display: 'flex' }}>
          <Box
            component="form"
            sx={{ width: '80%' }}

            noValidate
            autoComplete="off"

          >
         

          </Box>
          {/* button add catagary------------------------------------------------ */}
          <Box sx={{ width: { lg: '20% ', md: '100%', sm: '100%', xs: '100%' }, justifyContent: 'center', display: 'flex', padding: '0px 35px 0px 35px' }}>
            <React.Fragment>
              <Button sx={{ backgroundColor: '#1976d2', color: 'white', width: { lg: '100%', md: '100%', sm: '100%', xs: '100%' } }} variant="outlined" onClick={handleClickOpen}>
                ADD Q & A
              </Button>
              <BootstrapDialog
                onClose={handleClose}
                aria-labelledby="customized-dialog-title"
                open={open}
              >
                <DialogTitle sx={{ m: 0, p: 2 }} id="customized-dialog-title">
                  Add Catagary
                </DialogTitle>
                <IconButton

                  aria-label="close"
                  onClick={handleClose}
                  sx={(theme) => ({
                    position: 'absolute',
                    right: 8,
                    top: 8,
                    color: theme.palette.grey[500],
                  })}
                >
                  <CloseIcon />
                </IconButton>
                <Formik
                initialValues={ini}
                onSubmit={handleSubmit}
                >
                  <Form>
                    <DialogContent dividers>

                      <Field as={TextField} label='catagary'></Field>

                      <DialogActions>
                        <Button sx={{ backgroundColor: '#1976d2', color: 'white' }} autoFocus 
                        type='submit'
                        onClick={handleClose}>
                          Submit
                        </Button>
                      </DialogActions>
                    </DialogContent>
                  </Form>
                </Formik>
              </BootstrapDialog>
            </React.Fragment>
          </Box>
        </Box>

        <TableContainer component={Paper}>
          <Table sx={{ minWidth: { xs: 200 }, mt: '10px' }} aria-label="customized table">
            <TableHead  >
              <TableRow >
                <StyledTableCell >No.</StyledTableCell>
                <StyledTableCell align="left">Question</StyledTableCell>
                <StyledTableCell align="left">Answer</StyledTableCell>
                <StyledTableCell align="left">Sub-Catagary Name</StyledTableCell>
                <StyledTableCell align="left">Catagary Name</StyledTableCell>

                <StyledTableCell align="right">Delete</StyledTableCell>
                <StyledTableCell align="right">Update</StyledTableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {list2.map((row,i) => (
                <StyledTableRow key={i}>
                  <StyledTableCell component="th" scope="row">
                    {i+1}
                  </StyledTableCell>
                  <StyledTableCell align="left">{row.calories}</StyledTableCell>
                  <StyledTableCell align="left">{row.calories}</StyledTableCell>
                  <StyledTableCell align="left">{row.calories}</StyledTableCell>
                  <StyledTableCell align="left">{row.calories}</StyledTableCell>

                  <StyledTableCell align="right">{row.carbs}</StyledTableCell>
                  <StyledTableCell align="right">{row.protein}</StyledTableCell>
                </StyledTableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </InteviewPortal>
    </>
  )
}

export default QandA
